	(207, '2024-05-12 18:21:51.130011+00', 'Broccolistamppot', 'Romige broccoli stamppot met zongedroogde tomaten. Een simpele vegetarische stamppot die binnen 20 minuten op tafel staat, ideaal!', '{"Schil de aardappels en snij ze in blokjes. Snij de broccoli in roosjes.","Zet een pan met ruim water en een flinke snuf zout op het vuur en kook de aardappels 12 minuten. Voeg de laatste 10 minuten de broccoli toe en kook ze samen in de pan gaar.","Giet het kookvocht uit de pan af en hou een kopje kookvocht apart.","Schep nu de crme frache erbij, nootmuskaat en naar smaak peper en zout en stamp tot je een lekkere romige broccolistamppot hebt. Optioneel kun je nog wat kookvocht toevoegen als je het nog smeuger wil maken.","Schep als laatste de zongedroogde tomaten erdoor en verdeel de stamppot over de borden. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2024/02/Broccoli-stamppot.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/02/Broccoli-stamppot-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/02/Broccoli-stamppot-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/02/Broccoli-stamppot-480x270.jpg}', '4', '20 minutes', '0a62a7d0-a165-4cda-96bf-b411a0b1b92b', NULL, NULL, 'https://www.eefkooktzo.nl/broccolistamppot/'),
	(132, '2024-01-10 08:09:00.354709+00', 'Shakshuka', 'Zalige shakshuka met cherrytomaatjes, paprika, kruiden en Boursin. Heerlijk romig en heel smaakvol. Perfecte makkelijke avondmaaltijd of lunch!', '{"Verwarm wat olie in een ruime koekenpan en fruit de ui en knoflook even aan.","Bak dan de paprika even mee tot hij wat zachter begint te worden.","Voeg de cherrytomaten toe samen met de kruiden en breng op smaak met peper en zout. Bak tot de tomaatjes bijna uit elkaar beginnen te vallen.","Verkruimel er wat Boursin overheen, laat wat zacht worden en meng dan door het geheel.","Maak kuiltjes en breek hierin de eieren.","Laat sudderen tot de eieren gaar zijn*. Verdeel dan naar smaak nog de rest van de Boursin eroverheen samen met wat verse peterselie. Serveer er optioneel een stokbroodje bij en eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2023/08/Shakshuka-met-cherrytomaten.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/08/Shakshuka-met-cherrytomaten-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/08/Shakshuka-met-cherrytomaten-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/08/Shakshuka-met-cherrytomaten-480x270.jpg}', '2', '20 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', '2024-01-13 00:16:27.233+00', 5, 'https://www.eefkooktzo.nl/shakshuka/'),
	(140, '2024-01-23 10:58:34.882017+00', 'Pasta ovenschotel', 'Pasta ovenschotel met kip en broccoli. Oftewel pasta al forno. Heerlijk gevulde ovenschotel met kaas die je zo de oven in schuift. Ideaal!', '{"Verwarm de oven voor op 200 graden boven- en onderwarmte.","Kook de pasta beetgaar in een pan water met een snuf zout.","Snij de broccoli in roosjes en kook ook deze in een pan met water en een snuf zout beetgaar.","Verhit een beetje olie in de koekenpan, fruit de ui en knoflook tot deze glazig begint te worden.","Bak de kip mee en voeg de knoflookpoeder, uienpoeder, paprikapoeder en peper en zout naar smaak toe.","Als de kip gaar is, voeg je de beetgaar gekookte pasta en de broccoli weer toe aan de pan samen met de kookroom, bouillon, de helft van de Parmezaanse kaas en de helft van de mozzarella.","Kook dit even goed in, voeg eventueel een maizena papje toe (1 eetlepel maizena, 1 eetlepel water) om de saus iets in te dikken.","Breng verder op smaak met peper en zout.","Verdeel de pasta over een ovenschaal, bestrooi met de rest van de kaas. Strooi er naar smaak nog wat gedroogde oregano overheen.","Schuif in de oven en bak de ovenschotel in ca. 15 minuten goudbruin. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2023/09/Pasta-ovenschotel-met-kip.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/09/Pasta-ovenschotel-met-kip-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/09/Pasta-ovenschotel-met-kip-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2023/09/Pasta-ovenschotel-met-kip-480x270.jpg}', '4', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/pasta-ovenschotel/'),
	(138, '2024-01-12 23:42:07.079465+00', 'Zelfgemaakte Pannenkoeken', 'Zelf pannenkoeken maken met eigen pannenkoekenmix', '{"Doe de bloem, melk, eieren en naar smaak suiker (denk 1  2 eetlepels) en een snufje zout in een grote kom.","Mix dit goed door elkaar met een garde of makkelijk met een handmixer zodat je een mooi glad beslag hebt (zonder klontjes!)","Doe een beetje boter in een koekenpan, even de boter laten smelten en doe hier een soeplepel met beslag. Beweeg je pan zachtjes zodat het beslag de bodem van de pan bedekt.","Op middelhoog vuur aanbakken en daarna je pannenkoek omdraaien (je kunt natuurlijk ook je pannenkoek flippen ;) ) Tot de pannenkoek aan beide zijdes mooi licht goud bruin is.","Dit is wat ik zelf doe (niet bepaald goed voor je pan - wel goed om de meest mooie pannenkoeken te maken) als de pannenkoek klaar is doe ik de pan even onder de kraan en spoel ik m snel af. Even droogmaken met een theedoek en weer op het vuur. Nieuwe boter erbij en bak zo alle pannenkoeken tot het beslag op is.","Serveer met alles wat je lekker lijkt (kijk hierboven voor wat tips)"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2015/03/Pannenkoeken.jpg}', '15', '25 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/zelfgemaakte-pannenkoekenmix/'),
	(143, '2024-01-26 17:26:38.66676+00', 'Vegan balletjes in zoetzure saus met rijst', 'Deze plantaardige balletjes op basis van linzen en quinoa zijn een mooi en lekker voorbeeld van hoe je balletjes in zoetzure saus kan maken zonder dat er vis of vlees aan te pas komt. ', '{"Breng een pot gezouten water aan de kook en kook de quinoa en de linzen gaar. ","Zet een grote pan op het vuur met een scheut olie. Schil de wortelen en de paprikas en pel de ajuin. Snijd de groenten in grote stukken en stoof ze aan in de olie. Verwijder de kern van de venkel, snijd de knol in grote stukken en voeg ze toe. Laat de groenten even stoven. ","Pel de ajuin voor de rijst en snipper ze fijn. Stoof de ajuin met de rijst aan in een scheutje olie. Voeg er twee keer de hoeveelheid water en een snuif zout aan toe en breng aan de kook. ","Snipper de chilipeper fijn, voeg hem samen met de tomatenpuree toe aan de groenten en laat even bakken. Voeg er de ketchup, de appelazijn en het water aan toe en breng het geheel aan de kook. Breng op smaak meteen flinke snuif zout en laat de zoetzure saus even doorkoken. ","Giet de linzen en de quinoa door een zeef en laat ze even uitlekken. Doe ze in de pot van de blender. Snipper de koriander grof en voeg hem toe. Laat de machine even draaien en doe de kikkererwtenbloem erbij. Laat de machine opnieuw draaien en breng het beslag op smaak met peper, zout komijn, een snuif gember en een snuif cayennepeper. ","Zet een pan op het vuur met een scheutje olie. Rol balletjes van het beslag en bak ze goudbruin in de olie. Let op dat de olie niet te heet wordt. Schep de gebakken balletjes uit de pan en hou ze even apart. ","Laat daarna een nieuw scheutje olie warm worden in dezelfde pan en kleur de noten in de olie. ","Schep een lepel rijst in een kom en lepel er de zoetzure saus over. Schep er enkele gebakken balletjes bij en werk af met koriander en wat gebakken cashewnoten. "}', '{https://images.vrt.be/orig/2024/01/18/c280c249-b624-11ee-b483-02b7b76bf47f.png}', NULL, '60 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://dagelijksekost.vrt.be/gerechten/vegan-balletjes-in-zoetzure-saus-met-rijst'),
	(141, '2024-01-25 12:00:50.622573+00', 'Butter Chicken', 'Butter Chicken is een recept uit de Indiase keuken en z ontzettend lekker. Dit gerecht zet je binnen 30-minuten op tafel, een echte aanrader!', '{"Snijd de kipdijfilet in blokjes en doe deze in een ruime kom. Doe hierbij 2 eetlepels Griekse yoghurt, 2 fijngesneden teentjes knoflook, 2 theelepels citroensap, 1 eetlepel Garam Masala en 1 theelepel zout. Meng dit goed door elkaar en zet even apart zodat het lekker kan intrekken.","Snipper vervolgens de uitjes. Verhit 2 eetlepels zonnebloemolie in een pan en fruit de uitjes rustig aan tot ze glazig zijn geworden. Voeg vervolgens 2 teentjes fijngesneden knoflook toe en bak deze even mee. Doe er dan 1 eetlepel Garam Masala, 1 theelepel paprikapoeder, een snufje kaneel en 1 theelepel zout bij. Bak dit ook even mee en tot slot doe je er n blik tomatenblokjes bij. Breng dit aan de kook en giet de slagroom erbij. Zet het vuur direct laag en pureer het geheel met de staafmixer tot een gladde massa.","Als de saus gepureerd is voeg je de kip toe aan de saus. Doe de deksel op de pan en laat dit vervolgens op middelhoog tot laag vuur een minuut of 15 lekker rustig pruttelen tot de kip gaar is.","Zodra de kip gaar is roer je 2 eetlepels roomboter door de saus (het gerecht heet niet voor niets &#x27; Butter Chicken&#x27; ;) ). Breng op smaak met peper &amp; zout en garneer eventueel met wat blaadjes koriander. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2016/05/Butter-Chicken-recept.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2016/05/Butter-Chicken-recept-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2016/05/Butter-Chicken-recept-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2016/05/Butter-Chicken-recept-480x270.jpg}', '4', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/butter-chicken/'),
	(142, '2024-01-25 12:01:32.376611+00', 'Quiche met feta, spinazie en tomaat', 'Quiche met feta, spinazie en tomaat: makkelijk om te maken, ideaal om voor te bereiden, gezond, snel klaar en ook nog eens ontzettend lekker. Aanrader!', '{"Verwarm de oven voor op 175 graden boven- en onderwarmte.","Vet de quichevorm in en verdeel het quichedeeg over de bodem. Prik met een vork gaatjes in de bodem en zet de vorm in de oven voor 15 minuten om de bodem even voor te bakken* (tip voor blind bakken van de bodem).","Snipper de sjalotten en snijd knoflook fijn. Doe een beetje olijfolie in een ruime pan en fruit de sjalotten en de knoflook tot deze glazig zijn.","Voeg daarna handje voor handje de verse spinazie toe tot je alles in de pan hebt en de spinazie gaar en geslonken is. Breng vervolgens de spinazie op smaak metde komijn, peper en zout.","Doe de spinazie daarna in een vergiet en laat het uitlekken.","Terwijl de quiche in de oven staat gaan we vulling maken. Neem een ruime kom en doe hierin 2 eieren en de kookroom. Mix dit goed door elkaar met een garde of een vork.","Neem de quichevorm en verdeel de spinazie over de bodem. Halveer de cherrytomaten en breek de feta in blokjes en verdeel ditook over de bodem. Giet hierover het eimengsel en strooi de geraspte kaas erover.","Doe de quiche nu in de oven voor ongeveer 40-45 minuten tot het eimengsel gestold is en de quiche goudgeel van kleur is. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2017/04/quiche-feta.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2017/04/quiche-feta-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2017/04/quiche-feta-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2017/04/quiche-feta-480x270.jpg}', '8', '65 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/quiche-feta-spinazie-en-tomaat/'),
	(145, '2024-01-29 17:18:41.029754+00', 'Babi pangang met nasi', '', '{"1 - Kook de rijst zoals op de verpakking. Doe dit in kippenbouillon in plaats van water. Giet de rijst af en laat helemaal afkoelen met de deksel erop.","2 - Voor de bereiding van het vlees breng je eerst het water met de gesneden knoflook steranijs, gemberpoeder, bruine suiker, ketjap sambal en rijstwijn aan de kook. Leg de karbonades er in en doe de deksel op de pan. Laat het ongeveer 10 minuten zachtjes koken en zet dan het vuur uit. Ze mogen in het vocht afkoelen tot je ze nodig hebt.","3 - Voor de saus snij je de ui en knoflook fijn en fruit je deze in een klontje boter. Voeg de steranijs en de komijn toe en roer het mengsel om. Doe de suiker en het sap van de atjar tjampoer erbij. Vervolgens de tomatenpuree en de geraspte gember. Roer de saus en breng aan de kook. 

Maak een papje met een beetje water en maizena. Roer in de saus terwijl je een beetje maizena toevoegt. De saus zal nu binden. Als de saus de gewenste dikte heeft doe je het vuur uit. Vergeet de steranijs niet uit de saus te halen","4 - Haal het vlees uit de marinade en laat uitlekken. Giet nog een klein beetje van de marinade in de saus die je zojuist gemaakt hebt. ","5 - Snij de prei de ui en de peper. Bewaar dit even.","6 - Voor de nasi maak je eerst het roerei door een pan met een scheutje olie te verwarmen en daar de eieren in te breken. Blijf roeren in de pan totdat het roerei klaar is. Haal het ei uit de pan en bewaar. De pan hoeft niet schoon! ","7 - Je kan nu in dezelfde pan eerst de ui dan de prei en de rode peper bakken. Snij de ham in vierkantjes en bak het even mee. Vervolgens kan je ook het roerei en de knoflookpoeder toevoegen. Voeg als laast de rijst toe. Schep de nasi goed op zodat de rijst weer lekker warm wordt.","8 - Dep het vlees droog met keukenpapier of een theedoek en bak het krokant in een flinke laag olie. Ongeveer 2 a 3 minuten per kant. Snij het vlees in dunne reepjes."}', '{https://assets-binnenstebuiten.kro-ncrv.nl/public/styles/facebook_crop/public/poms/still/2021-12/1644702.jpg?h=dec22bcf&itok=rKT_ICO-}', '4', '60 min', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://binnenstebuiten.kro-ncrv.nl/recepten/babi-pangang-met-nasi'),
	(210, '2024-05-14 06:21:27.682781+00', 'Citroen-knoflookkippenbouten met kruidige parelcouscous', '', '{"Verwarm de oven voor tot 180 C.","Dep de kippenbouten droog met keukenpapier en leg ze op de bakplaat bekleed met bakpapier","Rasp de knoflook. Boen de citroen schoon en rasp de gele schil van de vrucht. Meng de knoflook en de citroenrasp met 1 eetlepel olijfolie. Snijd decitroen in dunne plakjes.","Maak het vel van de kippenbouten voorzichtig los. Wrijf het knoflook-citroenmengsel onder het vel.Stop er ook de plakjes citroen en takjes rozemarijn bij. Besprenkel de kippenbouten met 2 eetlepels olijfolie en bestrooi rondom met zout en peper.","Rooster de kippenbouten in de voorverwarmde oven in ongeveer 45 minuten goudbruin en gaar.","Kook de parelcouscous volges aawijzigingen op de verpakking gaar. Snijd de paprika''s in reepjes. Hak de peterselie fijn.","Verhit in een koekenpan 2 eetlepels olijfolie. Bak de paprika 5 minuten. Schep er de vadouvan door en bak nog 1 minuut zachtjes.","Schep de parelcouscous door de paprika en bak smaak met zout en peper. Voeq de peterselie toe en breng op","Neem de kippenbouten uit de oven. Schep de parelcouscous bij de kippenbouten op de bakplaat."}', '{https://qfsraezjniacsdtipuzs.supabase.co/storage/v1/object/public/recipe-images/210/0}', '2', '60 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, NULL),
	(147, '2024-02-05 16:09:37.228664+00', 'Hartige scones van zuurkool met wortelsoep en cranberrysaus | BinnensteBuiten', 'En van Ramons favorieten winterse gerechten zijn hartige scones met zuurkool. En dat gaat hij vandaag maken op een prachtige plek in de buitenlucht, met een groot vuur. Geweldig vindt hij dat! Ramon serveer er een grote pan wortelsoep bij. ', '{"1 - Meng het zelfrijzend bakmeel met de bakpoeder","gedroogde tijm","mosterd en zout en peper. Snijd de zuurkool fijn en knijp het meeste vocht eruit. ","2 - Smelt de boter en voeg deze met de melk",eieren,"gewelde rozijnen en de zuurkool bij het bakmeel en kneed kort tot een samenhangend deeg. Laat het deeg 15 minuten afgedekt rusten.","3 - Voor de cranberrycompote: doe alle ingredinten (cranberries",suiker,sinaasappelschillen,"steranijs en water) in een pan en breng het aan de kook. ","4 - Laat het geheel 10 minuten zachtjes door pruttelen. Goed laten afkoelen en serveer de cranberrycompote bij de scones.","5 - Voor de wortelsoep: snijd de uien en knoflook en fruit dit in een scheutje olie","samen met de gember. Was de wortel en snijd in stukjes. Voeg de stukjes wortel bij de uien en stoof het geheel. ","6 - Doe vervolgens de harissa erbij","samen met de groentebouillon. Breng alles aan de kook en laat het 10 minuten zachtjes koken. ","7 - Rol het deeg voor de scones uit tot een dikke plak van 5 a 6 cm dik. En steek hier met een steker de scones uit.","8 - Leg ze op een bakplaat met bakpapier. Bestrijk de bovenkant met ei en bak ze op 200 graden voor ongeveer 15  18 minuten.","9 - Voor de clotted cream: snijd de kruiden fijn en meng het met de clotted cream. Breng op smaak met zout en peper.","10 - Pureer de soep en voeg kokosmelk toe. Laat 5 minuten koken. Breng op smaak met zout en peper."}', '{https://assets-binnenstebuiten.kro-ncrv.nl/public/styles/facebook_crop/public/poms/still/2024-01/2071739.jpg?h=c71d0c67&itok=P02f7hQJ}', NULL, NULL, '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://binnenstebuiten.kro-ncrv.nl/recepten/hartige-scones-van-zuurkool-met-wortelsoep-en-cranberrysaus'),
	(148, '2024-02-10 10:14:26.340482+00', 'Hachee slowcooker', 'Hachee uit de slowcooker. Een makkelijke en smaakvol gerecht uit de slowcooker met mijn &#039;geheime&#039; ingredinten voor de lekkerste hachee.', '{"Snij de runderlappen in kleine blokjes.","Verhit een olie en boter in een koekenpan en bak de blokjes rundvlees even aan.Strooi er naar smaak een beetje peper, zout en de paprikapoeder bij.","Doe het gebakken vlees in de slowcooker.","Snij ondertussen de sjalotjes in halve ringen.","Maak de koekenpan even schoon en verhit opnieuw olie en boter in de pan. Fruit de sjalots aan tot deze glazig zijn en doe deze dan op het vlees in de slowcooker.","Voeg 100 ml water toe aan het vlees en de uien in de slowcooker.","Doe de laurierblaadjes en de kruidnagel erbij. Verkruimel het blokje runderbouillon en ontbijtkoek erover.","Tot slot giet je het flesje bruine bier erbij en zet je de slowcooker voor 6 uur op high.","Om de saus in te dikken doe je het laatste uur de deksel van de slowcooker af.","Breng de hachee daarna op smaak met peper en zout en verwijder de laurierblaadjes en de kruidnagels. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2019/02/Hachee-slowcooker.jpg}', '4', '375 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/hachee-slowcooker/'),
	(149, '2024-02-10 10:15:15.601451+00', 'Shepherd''s Pie (ovenschotel met gehakt)', 'Shepherd&#x27;s Pie ook wel bekend als Cottage Pie is een ovenschotel met gehakt. Kruidig gehakt met groenten en een laagje romige aardappelpuree.', '{"Verwarm de oven voor op 200 graden boven- en onderwarmte.","Snipper de uien, snijd de knoflook fijn, de winterpeen schillen en in blokjes snijden en de prei in dunne ringen.","Verhit een beetje olie in een ruime koekenpan en fruit de ui en knoflook tot deze glazig beginnen te worden. Voeg dan de wortel toe en bak deze even mee.","Doe het gehakt hierbij in de pan, kruid met peper en zout en bak rul.","Tot slot doe je de prei erbij en bak je dit tot alle groenten iets zachter zijn geworden.","Voeg de bouillon, tomatenpuree,worcestershire saus, rozemarijn, tijm en het blaadje laurier toe. Laat dit even rustig pruttelen, kook de saus in en breng eventueel verder op smaak met peper en zout.","Bereid ondertussen de Aviko Aardappelpuree zoals aangegeven op de verpakking (dit kan in de magnetron, oven of pan).","Verdeel het gehaktmengsel over een ruime ovenschaal.","Daaroverheen verdeel je de aardappelpuree. Je kunt eventueel n of twee lepeltjes crme frache toevoegen en de bovenste laag met een spuitzak in mooie toefjes spuiten.","Zet de ovenschotel met gehakt nu voor 30 minuten in de oven en eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2019/01/shepherds-pie-maken.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2019/01/shepherds-pie-maken-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2019/01/shepherds-pie-maken-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2019/01/shepherds-pie-maken-480x270.jpg}', '4', '50 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/shepherds-pie/'),
	(151, '2024-02-10 12:11:57.533424+00', 'Varkensgebraad, schorseneren in witte saus en gekookte aardappelen', 'Vandaag staat er weer zo&#039;n gouwe ouwe op het menu: varkensgebraad &#039;en cocotte&#039; met schorseneren in witte saus en een eenvoudig gekookt patatje erbij. Je hoeft het niet altijd ver te zoeken om tot een geweldig resultaat te komen! ', '{"Verwarm de oven voor op 180 graden. Haal het vlees tijdig uit de koelkast en laat het op temperatuur komen. Zet een grote pot op het vuur en laat er een klont boter in smelten. Kruid het varkensgebraad met peper en zout en kleur het gebraad aan alle kanten in de boter. ","Pel de uien en snijd ze in reepjes. Pel en plet de look. Voeg de uien en de look toe. Voeg er de kruidnagels, tijm, de rozemarijn en de laurier aan toe. Voeg een scheut water toe bij het gebraad voor het aanmaken van de jus. ","Bedek het gebraad met een flinke laag mosterd, zet een deksel op de pot en schuif de pot 20 tot 25 minuten in de oven. Haal het gebraad na de gaartijd uit de oven en laat het nog eens 20 tot 25 minuten rusten. ","Schil de aardappelen, snijd ze in grote stukken en kook ze gaar in gezouten water. Giet de schorseneren door een zeefje en doe het sap weg. ","Bechamel bereiding en afwerking","Laat de boter smelten en voeg er de bloem aan toe. Meng beide tot een roux en giet er de melk al roerend bij. Breng het geheel op een zacht vuurtje aan de kook, tot je een gebonden saus hebt. ","Breng de saus op smaak met peper, zout, een snuif nootmuskaat en het sap van een halve citroen. Laat de kaas erin oplossen. ","Meng de schorseneren onder de kaassaus en laat het geheel nog even opwarmen. Giet de aardappelen af wanneer ze gaar zijn. Snijd het gebraad in dunne plakken en serveer met gekookte aardappelen en schorseneren in witte saus. Lepel er op het einde nog wat van de gestoofde uien bij "}', '{https://images.vrt.be/orig/2024/02/04/64de3084-c38a-11ee-b483-02b7b76bf47f.jpg}', '4', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://dagelijksekost.vrt.be/gerechten/varkensgebraad-schorseneren-in-witte-saus-en-gekookte-aardappelen'),
	(150, '2024-02-10 10:17:31.472074+00', 'Jambalaya met kip', 'Jambalaya met kip. Een heerlijke kruidige rijstschotel met kip en chorizo. Comfort food ten top deze Amerikaanse jambalaya.', '{"Verhit een beetje olie in een pan en fruit de ui en knoflook even aan.","Voeg dan de paprika en tomaat toe en bak dit even mee tot de groenten zacht beginnen te worden.","Dan doe je de chorizo worst en kip erbij. Kruid met de cajun kruiden, peper en zout en bak gaar op middelhoog vuur.","Voeg dan de tomatenblokjes toe en de bouillon.","Schep om, breng aan de kook en voeg de rijst toe. Laat het geheel nu met de deksel erop gaar koken en roer het af en toe even om. Hou hierbij in de gaten of de rijst mooi gaar wordt. Je kunt (indien nodig) wat extra water toevoegen of juist de deksel wat langer van de pan laten zodat het vocht kan verdampen.","Proef of de rijst gaar is. Breng verder op smaak met peper en zout. Garneer met peterselie en eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2022/07/jambalaya.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/jambalaya-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/jambalaya-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/jambalaya-480x270.jpg}', '4', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', '2024-02-15 22:30:51.478+00', 4, 'https://www.eefkooktzo.nl/jambalaya-met-kip/'),
	(152, '2024-02-21 14:14:22.887614+00', 'Babi Ketjap en Nasi Goreng', 'Chef-kok Ramon is in oosterse sferen: hij maakt babi ketjap met nasi goreng. Daarbij maakt hij zelfgemaakt zoetzuur.', '{"1 - Begin met de nasi goreng. Kook hiervoor de rijst volgens de verpakking.","2 - Snij de ui","knoflook en paprika en zet dit aan in de pan met een scheutje olie.","3 - Snij de prei en voeg dit samen met de trassi toe aan de pan.","4 - Snij de peper en de gember en voeg dit laos en de gemalen koriander toe aan de pan. Doe de rijst erbij en de ketjap en bak dit goed aan.","5 - Voor de babi ketjap snij je de ui en knoflook fijn en bak zet dit aan in een pan met olie.","6 - Snij het vlees in blokjes en voeg toe aan de pan.","7 - Doe de ketjap","citroensap en sambal erbij en breng dit aan de kook.","8 - Rasp de gember en voeg dit ook toe.","9 - Kook het vocht nu in tot het mooi aan het vlees blijft plakken.","10 - Rasp de komkommer voor het zoetzuur. Voeg daar de azijn","water en suiker aan toe en roer het goed door. Laat het een uur staan voordat je het eet.","11 - Serveer de nasi met babi ketjap met de gebakken uitjes","gebakken ui","kroepoek en seroendeng"}', '{https://assets-binnenstebuiten.kro-ncrv.nl/public/styles/facebook_crop/public/poms/still/2020-06/1276359.jpg?h=c71d0c67&itok=2Joaw0PX}', '4', '> 60 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://binnenstebuiten.kro-ncrv.nl/recepten/babi-ketjap-en-nasi-goreng'),
	(154, '2024-04-18 08:41:26.191482+00', 'Enchiladas met gehakt', 'Makkelijk recept voor de LEKKERSTE Mexicaanse enchiladas met gehakt uit oven. Heerlijk vol van smaak en binnen 30 minuten op tafel.', '{"Verwarm de oven voor op 180 graden boven- en onderwarmte.","Doe de tomatenblokjes in een steelpan. Voeg daar vervolgens aan toe: 1 fijngesneden teentje knoflook, 1 eetlepel suiker,  eetlepel oregano, 1 theelepel komijn, 1 theelepel uienpoeder en peper &amp; zout naar smaak. Laat op laag vuur zachtjes pruttelen.","Verwarm in een koekenpan een beetje olie of boter en fruit de ui samen met de overige 2 teentjes fijngesneden knoflook en de paprikablokjes.","Voeg de volgende kruiden toe en bak even mee: 2 theelepels komijn, 2 theelepels cacaopoeder, 1 theelepel paprikapoeder, 1 theelepel gerookt paprikapoeder,  theelepel piment en 1 theelepel oregano.","Dan voeg je het gehakt toe en rul deze bruin. Breng verder op smaak met peper en zout. Meng op het laatst de mais erdoor.","Verdeel een beetje van het gehaktmengsel op een wrap, verdeel er wat geraspte kaas over en rol op. Herhaal met de rest van de wraps.","Verdeel 2/3 van de tomatensaus over de bodem van een ovenschaal en leg de opgerolde wraps erop.","Tot slot verdeel je nog wat tomatensaus over de bovenkant en de geraspte kaas.","Zet het geheel in de oven voor ca. 10 minuten tot de kaas volledig is gesmolten. Garneer optioneel met bosui. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2022/01/Enchiladas-met-gehakt.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/01/Enchiladas-met-gehakt-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/01/Enchiladas-met-gehakt-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/01/Enchiladas-met-gehakt-480x270.jpg}', '4', '25 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/enchiladas-met-gehakt/'),
	(155, '2024-04-18 08:41:36.789566+00', 'Pumpkin Soup', 'Makkelijk pompoensoep basisrecept. Een heerlijk recept voor een herfstige pompoensoep. Simpel, maar ontzettend lekker!', '{"Schil de pompoen, verwijder de zaadjes en snij in de grove stukken.","Schil de aardappel en snij in grove stukken. Snipper de uien en knoflook.","Verhit een beetje olijfolie in de pan, fruit de ui en knoflook even aan en voeg de komijnpoeder en kurkuma toe.","Voeg dan de aardappel en de pompoen toe.","Giet de bouillon erbij en breng het aan de kook.","Laat nu 15-20 minuten even zachtjes koken tot alle groenten zacht zijn.","Zet de staafmixer erin en pureer glad. Breng op smaak met peper en zout en een scheut kookroom naar smaak."}', '{https://www.eefkooktzo.nl/wp-content/uploads/2021/09/Klassieke-pompoensoep.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2021/09/Klassieke-pompoensoep-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2021/09/Klassieke-pompoensoep-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2021/09/Klassieke-pompoensoep-480x270.jpg}', '4', '25 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/pompoensoep/'),
	(156, '2024-04-18 08:41:47.597674+00', 'Flammkuchen', 'Het recept voor een heerlijke flammkuchen met spekjes, crme frache, rode ui en zwarte peper. De klassieker, zo lekker!', '{"Maak het deeg zoals aangegeven in het recept of gebruik een rol kant-en-klaar flammkuchen deeg. Bak het deeg nog niet af.","Verwarm de oven voor op 220 graden boven- en onderwarmte.","Bak de spekjes uit in een pan en laat ze even uitlekken op een velletje keukenpapier om het overtollige vet te absorberen.","Snij de ui in dunne ringen, gebruik hiervoor eventueel een mandoline.","Rol het deeg uit, uit de helft van het flammkuchen deeg recept haal je 2 porties.","Verdeel de crme frache over het deeg, daaroverheen verdeel je de spekjes en de rode ui. Breng op smaak met versgemalen zwarte peper.","Leg de flammkuchen in de oven en bak hem in ca. 10-15 minuten licht knapperig en gaar. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2022/07/flammkuchen-recept.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/flammkuchen-recept-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/flammkuchen-recept-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2022/07/flammkuchen-recept-480x270.jpg}', '2', '15 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', '2024-05-01 08:12:29.078+00', 5, 'https://www.eefkooktzo.nl/flammkuchen/'),
	(153, '2024-04-13 06:43:44.76479+00', 'Marry Me Chicken Meatball Orzo', 'This one-pan dinner is incredibly delicious and super easy to make: tender meatballs, smooth orzo and a creamy sun-dried tomato sauce ready in just 30 minutes. Perfect for a cozy date night or family gathering!', '{"Get your prep done before you start cooking: Finely chop the shallot and mince the garlic cloves. Chop the basil and sun-dried tomatoes.","Combine all the ingredients for the meatballs in a large bowl. Mix until just combined, using your hands. Roll the meat into 2 tablespoon-sized balls. It makes for about 18 meatballs.","Heat oil and butter over medium in a large nonstick skillet or pot. Add meatballs and brown all over. Remove from skillet. They don&#x27;t need to be cooked through, we will finish them later.","Add shallot and garlic, cook for 2 minutes until fragrant. Add orzo and toast for 1 minute. Stir in salt, pepper, oregano and tomato paste.","Pour in chicken broth and bring to a boil. To maintain a simmer, reduce the heat to low. Cook uncovered while stirring occasionally to keep the orzo from sticking, until almost al dente and the liquid is absorbed, about 10 minutes.","Add cream, sun-dried tomatoes and basil. Sprinkle with lemon juice and stir in Parmesan. Return meatballs to the skillet, cover and simmer for 5 minutes or until the meatballs are cooked through.","Finish off with chili flakes and freshly grated black pepper. Enjoy!"}', '{https://www.servingdumplings.com/wp-content/uploads/2024/01/marry-me-chicken-meatball-orzo-tn-2d677fa7.jpg}', '4', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.servingdumplings.com/recipe/marry-me-chicken-meatball-orzo/'),
	(205, '2024-05-12 07:32:36.980413+00', 'American pancakes', 'Lekker als ontbijt, lunch of gewoon tussendoor: American pancakes. Dit makkelijke recept is een absolute topper, je kunt er eindeloos mee variren.', '{"Doe alle ingredinten in een mengkom en mix dit goed door elkaar. Ik schep het beslag altijd in de pan met een juslepel, maar je kunt ook een kan of fles gebruiken en het in de pan gieten.","Doe een beetje boter in de pan en giet het beslag in de pan. In mijn pan passen ongeveer drie pancakes tegelijk. Zodra de pancakes belletjes krijgen aan de bovenkant kun je ze omdraaien. Dan hebben ze nog maar kort nodig.","Lekker Amerikaans, serveer ze als een grote stapel en giet er stroop (of beter: maple syrup) overheen."}', '{https://www.laurasbakery.nl/wp-content/smush-webp/2013/06/American-pancakes-bakken.jpg.webp,https://www.laurasbakery.nl/wp-content/smush-webp/2013/06/American-pancakes-bakken-500x500.jpg.webp,https://www.laurasbakery.nl/wp-content/smush-webp/2013/06/American-pancakes-bakken-500x375.jpg.webp,https://www.laurasbakery.nl/wp-content/smush-webp/2013/06/American-pancakes-bakken-480x270.jpg.webp}', '15', '30 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', '2024-05-12 09:40:00+00', 5, 'https://www.laurasbakery.nl/american-pancakes/'),
	(211, '2024-05-16 12:10:26.554035+00', 'Preisoep', 'Preisoep. Een heerlijke, klassieke preisoep met aardappel, prei, bouillon en room. Absoluut erg smaakvol! Perfect als lunch of voorgerecht.', '{"Verhit wat olijfolie in een grote (soep)pan op middelhoog vuur.","Voeg de ui en knoflook toe en bak ze tot ze zacht en lichtbruin zijn.","Voeg de prei toe aan de pan en bak deze ongeveer 5 minuten mee, totdat de prei zacht begint te worden.","Voeg de aardappelen toe en roer alles goed door elkaar.","Kook het water en giet dit in de pan samen met de bouillonblokjes en paprikapoeder. Breng het geheel aan de kook.","Laat ca. 20-25 minuten zachtjes koken, of tot dat de aardappelen volledig gaar zijn.","Haal de pan van het vuur en gebruik een staafmixer om de soep fijn te malen.","Meng de kookroom door de soep en breng op smaak met zout en peper.","Serveer de preisoep met de bosui en eventueel nog een scheutje olijfolie, croutons en een stokbroodje erbij. Eet smakelijk!"}', '{https://www.eefkooktzo.nl/wp-content/uploads/2024/03/Preisoep.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/03/Preisoep-500x500.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/03/Preisoep-500x375.jpg,https://www.eefkooktzo.nl/wp-content/uploads/2024/03/Preisoep-480x270.jpg}', '6', '35 minutes', '1e45e8f3-b730-4952-92b9-3aa00e674d87', NULL, NULL, 'https://www.eefkooktzo.nl/preisoep/'),
	(161, '2024-04-24 11:32:48.241317+00', 'Beef Stew with Carrots & Potatoes', 'This classic French beef stew is the ultimate cold weather comfort food. After a few hours in the oven, the meat becomes meltingly tender and enveloped in a rich wine sauce.', '{"Preheat the oven to 325F and set a rack in the lower middle position.","Pat the beef dry and season with the salt and pepper. In a large Dutch oven or heavy soup pot, heat 1 tablespoon of the olive oil over medium-high heat until hot and shimmering. Brown the meat in 3 batches, turning with tongs, for about 5 minutes per batch; add one tablespoon more oil for each batch. (To sear the meat properly, do not crowd the pan and let the meat develop a nice brown crust before turning with tongs.) Transfer the meat to a large plate and set aside.","Add the onions, garlic and balsamic vinegar; cook, stirring with a wooden spoon and scraping the brown bits from bottom of the pan, for about 5 minutes. Add the tomato paste and cook for a minute more. Add the beef with its juices back to the pan and sprinkle with the flour. Stir with wooden spoon until the flour is dissolved, 1 to 2 minutes. Add the wine, beef broth, water, bay leaf, thyme, and sugar. Stir with a wooden spoon to loosen any brown bits from the bottom of the pan and bring to a boil. Cover the pot with a lid, transfer to the preheated oven, and braise for 2 hours.","Remove the pot from the oven and add the carrots and potatoes. Cover and place back in oven for about an hour more, or until the vegetables are cooked, the broth is thickened, and the meat is tender. Fish out the bay leaf and discard, then taste and adjust seasoning, if necessary. Serve the stew warm -- or let it come to room temperature and then store in the refrigerator overnight or until ready to serve. This stew improves in flavor if made at least 1 day ahead. Reheat, covered, over medium heat. Garnish with fresh parsley, if desired.","Note: If you dont have a Dutch oven or covered pot that is appropriate for the oven, the stew can be cooked on the stove. The timing will be the same and it should be cooked over the lowest setting.","<strong>Freezer-Friendly Instructions:</strong> The stew can be frozen for up to 3 months. Before serving, defrost the stew in the refrigerator for 24 hours and then reheat on the stovetop over medium-low heat until hot."}', '{https://www.onceuponachef.com/images/2011/02/beef-stew-with-carrots-potatoes-1200x834.jpg}', '6', '3 hours 30 minutes', '9943745d-99f0-4143-98e8-d7449e85687e', NULL, NULL, 'https://www.onceuponachef.com/recipes/beef-stew-with-carrots-potatoes.html');


